import styles from "./Suggestion.module.css";
export default function Suggestion() {
  <article className={styles.suggestion}>
    <div>Upvote</div>
    <section>
      <h3>Suggestion Name</h3>
      <p>Suggestion text message this is it.</p>
      <span>Suggestion Tag</span>
    </section>
    <div>Comments</div>
  </article>;
}
